import axios from 'axios';

export const fetchTamanhos = async () => {
  const response = await axios.get('https://65f4ffa8f54db27bc02286b4.mockapi.io/tamanho');
  return response.data; // Retorna diretamente os dados
};

export const fetchSabores = async () => {
  const response = await axios.get('https://65f4ffa8f54db27bc02286b4.mockapi.io/sabores');
  return response.data; // Retorna diretamente os dados
};
